import axios from "axios";
import React from "react";
import { useEffect, useState } from "react";
import "./style.css";
import { Link } from "react-router-dom";
import pro from "./img/Bootlabs-logo.gif";
import dell from "./img/Dell.webp"
import lap from "./img/Laptops.webp"
import { ReactComponent as IconSearch } from "bootstrap-icons/icons/search.svg";
import { ReactComponent as IconCart3 } from "bootstrap-icons/icons/cart3.svg";
export default function Signin()
{
    const [name, setName] = useState("")

    async function handleSubmit()
    {

        // alert("Task have been submitted successfully");
        // axios.all([
        //     await axios.post(`http://${process.env.REACT_APP_APP_URL}/task/` ,{ name:name,task: task})
        //         .then((data) => {
        //             console.log(data);
        //             setName("")
        //             setTask("")
        //         }).then(() =>{
        //
        //             axios.get(`http://${process.env.REACT_APP_APP_URL}/tasks/`)
        //                 .then((response) => {
        //                     setData(response.data)
        //                 })})
        // ])
    }
    return (
        <React.Fragment>
            <header className="p-3 border-bottom bg-light">
                <div className="container-fluid">
                    <div className="row g-3">
                        <div className="col-md-3 text-center">

                            <img className="img" src={pro} ></img>

                        </div>
                        <div className="col-md-5">

                            <form action="#" className="search">
                                <div className="input-group">
                                    <input
                                        id="search"
                                        name="search"
                                        type="text"
                                        className="form-control"
                                        placeholder="Search"
                                        required
                                    />
                                    <label className="visually-hidden" htmlFor="search"></label>
                                    <button
                                        className="btn btn-primary text-white"
                                        type="submit"
                                        aria-label="Search"
                                    >
                                        <IconSearch />
                                    </button>
                                </div>
                            </form>
                        </div>
                        <div className="col-md-4">

                            <div className="position-relative d-inline me-3">
                                <Link to="/cart" className="btn btn-primary">
                                    <IconCart3 className="i-va" />
                                    <div className="position-absolute top-0 start-100 translate-middle badge bg-danger rounded-circle">
                                        2
                                    </div>
                                </Link>
                            </div>&emsp;
                            <div className="btn-group">
                                <button className="buttons"><Link to="/signin">Sign In</Link></button>
                            </div>

                        </div>
                    </div>
                </div>
            </header>
            <div className="container my-3">
                <div className="row border">
                    <div className="col-md-6 bg-light bg-gradient p-3 d-none d-md-block">
                        <Link to="/">
                            <img
                                src={dell}
                                alt="..."
                                className="img-fluid"
                            />
                        </Link>
                        <Link to="/">
                            <img
                                src={lap}
                                alt="..."
                                className="img-fluid"
                            />
                        </Link>
                    </div>
                    <div className="col-md-6 p-3">
                        <form onSubmit={handleSubmit}>
                        <h4 className="text-center">Sign Up</h4>

                        <label className="labelss">First Name: </label> <input className="uplabeldata" type="text" value={name} onChange={(e) => setName(e.target.value)} required placeholder="Enter your First name"
                        // onChange={(e) => setName(e.target.value)} required
                    /><br/>
                        <label className="labelss">Last Name: </label> <input className="uplabeldata" type="text" id="name" placeholder="Enter your Last name"
                        // onChange={(e) => setName(e.target.value)} required
                    /><br/>
                        <label className="labelss">Email Id: </label> <input className="uplabeldata" type="email" id="name" placeholder="Mail Id"
                        // onChange={(e) => setName(e.target.value)} required
                    /><br/>
                        <label className="labelss">Mobile No: </label> <input className="uplabeldata" type="number" id="name" placeholder="Mobile no"
                        // onChange={(e) => setName(e.target.value)} required
                    /><br/>
                        <label className="labelss">Create Password: </label><input className="uplabeldata" type="text" id="name" placeholder="*********"
                        // onChange={(e) => setName(e.target.value)} required
                    />
                        <button className="signinbutton"> <Link className="sign" to="/">Create Account</Link> </button>
                        </form>
                    </div>
                </div>
            </div>
        </React.Fragment>

    );

}
